	@Inject
	public ToscaDslGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pTopologyTemplate = new TopologyTemplateElements();
		this.pEString = new EStringElements();
		this.pImport = new ImportElements();
		this.pParameter = new ParameterElements();
		this.pNodeTemplate = new NodeTemplateElements();
		this.pRelationship = new RelationshipElements();
		this.pGroup = new GroupElements();
		this.pPolicy = new PolicyElements();
		this.pInterface = new InterfaceElements();
		this.pProperty = new PropertyElements();
		this.pAttribute = new AttributeElements();
		this.pRequirement = new RequirementElements();
		this.pCapability = new CapabilityElements();
		this.pOperation = new OperationElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.xtext.example.mydsl.ToscaDsl".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
